import string

def translate_phrase(phrase):
    return string.ascii_lowercase.join(string.ascii_lowercase.findall(phrase))

def combine_phrase(phrase1, phrase2):
    return phrase1.join(phrase2)

def main():
    print(translate_phrase("good morning"))
    print(combine_phrase(translate_phrase("good morning"), translate_phrase("صباح الخير")))

if __name__ == "__main__":
    main()
